import React from "react";
import { Row, Col, Button, Typography, Progress } from "antd";
import { useRouter } from "next/router";
import { useSelector } from "react-redux";
const { Text } = Typography;

import calculator from "../../back/calculator";
import Feature from "../../components/Feature";

const End = () => {
	const { ans } = useSelector((state) => state.answer);
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	return (
		<>
			<Row>
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "50px",
						fontSize: "20px",
					}}
				>
					나의 유형은
				</Text>
			</Row>
			<Row>
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "25px",
					}}
				>
					(여기에 유형 입력)
				</Text>
			</Row>
			<Row>
				<Text
					strong
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "5px",
						fontSize: "30px",
						color: "#be2edd",
					}}
				>
					{calculator(ans)}
				</Text>
			</Row>
			<Row>
				<img
					style={{
						display: "block",
						marginLeft: "auto",
						marginRight: "auto",
						marginBottom: "30px",
						width: "200px",
						height: "auto",
					}}
					src={require("../../assets/dog.png")}
				/>
			</Row>

			<Feature title={"애정표현력"} value={40} />
			<Feature title={"눈치력"} value={40} />
			<Feature title={"썸추진력"} value={60} />
			<Feature title={"19금력"} value={40} />
			<Feature title={"마이웨이력"} value={100} color={"#eb4d4b"} />

			<Row>
				<Button
					style={{ display: "block", marginTop: "20px" }}
					onClick={toTop}
				>
					처음으로
				</Button>
			</Row>
		</>
	);
};

export default End;
